// EditEmployee.js
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

function EditEmployee() {
  const { empid } = useParams();
  const [employeeData, setEmployeeData] = useState(null);

  useEffect(() => {
    // Fetch employee data using empid
    // Example fetch request:
    fetch(`/api/employees/${empid}`)
      .then((response) => response.json())
      .then((data) => setEmployeeData(data))
      .catch((error) => console.error("Error fetching employee data:", error));
  }, [empid]);

  return (
    <div>
      <h1>Edit Employee</h1>
      {employeeData && (
        <div>
          <p>Employee ID: {employeeData.empid}</p>
          <p>Name: {employeeData.ename}</p>
          <p>Designation: {employeeData.designation}</p>
          <p>Joining Date: {employeeData.jdate}</p>
          <p>Status: {employeeData.status}</p>
          {/* Add other employee details as needed */}
        </div>
      )}
    </div>
  );
}

export default EditEmployee;
